#include <iostream>
#include <vector>
using namespace std;

void swap(int &x, int &y) {
    int t = x;
    x = y;
    y = t;
}

int partition(vector<int> &a, int l, int h) {
    int pivot = a[h], i = l - 1;
    for (int j = l; j < h; j++) {
        if (a[j] <= pivot) {
            i++;
            swap(a[i], a[j]);
        }
    }
    swap(a[i + 1], a[h]);
    return i + 1;
}

void q_sort(vector<int> &a, int l, int h) {
    if (l < h) {
        int pi = partition(a, l, h);
        q_sort(a, l, pi - 1);
        q_sort(a, pi + 1, h);
    }
}

void traverse(const vector<int> &a) {
    for (int i : a) cout << i << " ";
    cout << endl;
}

